import axios from "axios";
export async function  updateToDo ({pid,todo})  {
    
    return axios.patch(`http://localhost:8000/${pid}/${todo._id}`, {
      todo
    })
      .then((res) => console.log(res.data))
      .catch(function (error) {
        console.log(error);
      });
        
     
  }
